/* addresslex_destroy is for both reentrant and non-reentrant scanners. */
int addresslex_destroy  (void)
{
    
    /* Pop the buffer stack, destroying each element. */
	while(YY_CURRENT_BUFFER){
		address_delete_buffer(YY_CURRENT_BUFFER  );
		YY_CURRENT_BUFFER_LVALUE = NULL;
		addresspop_buffer_state();
	}

	/* Destroy the stack itself. */
	addressfree((yy_buffer_stack) );
	(yy_buffer_stack) = NULL;

    /* Reset the globals. This is important in a non-reentrant scanner so the next time
     * addresslex() is called, initialization will occur. */
    yy_init_globals( );

    return 0;
}

